                "id": "UniProtKB-KW:KW-0945",
                "label": "Host-virus interaction",
                "description": "Viral or cellular protein involved in a host-virus interaction. Viruses interact with many cellular pathways to achieve their replication cycle. Entry into the host cell, transport to the viral replication sites or viral exit from the host cell are all steps that require specific interactions between the virus and its host. Additionally, the evasion from the host immune response requires a lot of viral proteins to associate with and inhibit cellular proteins with antiviral functions.",
